import React, { Component } from 'react'
import MainNavigation from "./Layout/MainNavigation"
import Modal from "./photo"

// Imports for
import AmtrakEighteenthStreet from "./Photos/18th Street Yards.jpg"

function Tag(props) {
    return(
        <div class="container-for-image">
            <img class = "gallery-image" src={props.photo} alt=""></img>
            <div class="overlay">
                <div class="image-text">Amtrak at Big Ten</div>
                  </div>
                </div>
    )
}

export default Tag;
